

CREATE TABLE `bio_data` (
  `user_id` bigint(14) NOT NULL,
  `full_name` varchar(255) NOT NULL,
  `course_name` varchar(255) NOT NULL,
  `email` varchar(150) DEFAULT NULL,
  `mobile` bigint(13) NOT NULL,
  `website` varchar(255) DEFAULT NULL,
  `gender` varchar(5) NOT NULL,
  `languages` varchar(255) DEFAULT NULL,
  `about` longtext NOT NULL,
  `profile_pic` longtext NOT NULL,
  `profile_pic_type` varchar(100) NOT NULL,
  `certificate_image` longtext NOT NULL,
  `certificate_image_type` varchar(100) NOT NULL,
  `id_card` longtext NOT NULL,
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `mobile` (`mobile`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

